    false,nt"url": null,nt"notes": "This report summarizes the findings of
    a survey for nesting birds of prey along the Cooper River in Alaska. The primary
    objectives of the study were as follows: identify nesting locations for birds of
    prey in the river corridor; determine the status of nest sites encountered; band
    young where possible; obtain physical data on all nest sites encountered; identify
    prey remains found in and near nest sites; and make the information obtained available
    to other federal, state, and private land managing agencies to promote the conservation
    of raptors along the Copper River.",nt"license_title": "License Not Specified",nt"extras":
